import React from "react";
import { useDispatch, useSelector } from 'react-redux';
import { FaRegComment, FaRetweet , FaRegBookmark } from "react-icons/fa6";
import { IoIosStats } from "react-icons/io";
import { FiShare } from "react-icons/fi";
import axios from "axios";
import Avatar from "react-avatar";
import toast from "react-hot-toast";
import { useState } from 'react';
import { API_KEY_TWEET } from "../utensiles/constants";
import { getRefresh } from '../redux/Tweetslice';
import { MdDelete } from "react-icons/md";
import { CiHeart } from "react-icons/ci";
const Tweet = ({ tweet }) => {
    const { user } = useSelector(store => store.user);

    const dispatch = useDispatch();
    const submitHandler = async (id) => {
        try {
            const res = await axios.delete(`${API_KEY_TWEET}/deletetweet/${id}`, { id: user?._id }, {
                withCredentials: true
            });
            console.log(res);
            dispatch(getRefresh());


        } catch (error) {

            console.log(error);
        }
    };

    const submitHandler2 = async (id) => {
        try {
            const res = await axios.put(`${API_KEY_TWEET}/likesanddislikeds/${id}`, { id: user?._id }, {
                withCredentials: true
            });
            console.log(res);
            dispatch(getRefresh());


        } catch (error) {

            console.log(error);
        }
    };
return (<div >
        <div className="flex hover:bg-gray-100 h-32 pt-6 border border-gray-100">
            <div className='rounded-full ml-3 '>
                <Avatar
                    src='data:image/jpeg;base64,'
                    size={40} round={true}/>
            </div>
            <div>
                <div className="flex gap-1 justify-between font-semibold  ml-3 w-[400px]">
                    <p>{tweet?.userDetails[0].name}</p>
                    <p className="text-gray-500 ">{`@${tweet?.userDetails[0].username}`}</p>
                    {console.log(tweet?.userDetails[0].username)}
                    <p className="text-gray-500">Mar 21</p>
                </div>
                <div>
                    <p className="ml-3 mt-1 border-gray-700"> {tweet?.description}</p>
                    <div className="flex w-full justify-between mt-4 ml-3 w-[600px]">
                        <div className="flex items-center gap-1 hover:bg-green-200 rounded-full cursor-pointer">
                       <div> <FaRegComment size={20}/> </div>
                            <p>0</p>
                        </div>
                        <div className="flex items-center gap-1">
                           <div> <FaRetweet size={20}/> </div>
                            <p>0</p>
                        </div>
                            <div className="flex items-center gap-1">
                               <div onClick={() => submitHandler2(tweet?._id)} className="hover:bg-red-400 rounded-full" > <CiHeart size={20}/></div>
                                <p>{tweet?.Likes?.length}</p>
                            </div>

                               <div className="flex items-center gap-1 "><IoIosStats size={20}/>
                               <p>27M</p>
                    </div>
                        {user?._id === tweet?.userId && (
                        <div className="flex items-center gap-1">
                           <div onClick={() => submitHandler(tweet?._id)}> < MdDelete size={20}/></div>
                           <FiShare size={20}/>
                        </div>)}
                        </div>  </div>
                    </div>
                </div>

        </div>

    );

}


export default Tweet;